def get_wkt_from_shp_file(geojson_path):
    file = open(geojson_path, "rb")
    try:
        wkt_str = test_file.parse_shp(file)
    except Exception as e:
        # This will always fail. This way it shows you what 'e' is in console:
        file.close()
        assert str(e) == None
    file.close()
    return wkt_str


